#include<bits/stdc++.h>
using namespace std;
inline int read(){
	int s=0,w=1;
	char ch=getchar();
	while(ch<'0'||ch>'9'){
		if(ch=='-')w=-1;
		ch=getchar();
	}
	while(ch>='0'&&ch<='9'){
		s=(s<<1)+(s<<3)+(ch^48);
		ch=getchar();
	}
	return s*w;
}
typedef unsigned long long ULL;
const int P=131;
ULL h[1000005];
char str[1000005];
int ans;
int main(){
	int n=read();
	for(int i=1;i<=n;i++){
		scanf("%s",str+1);
		int len=strlen(str+1);
		for(int j=1;j<=len;j++){
			h[i]=h[i]*P+str[j];
		}
	}
	sort(h+1,h+1+n);
	for(int i=1;i<=n;i++){
		if(h[i]!=h[i-1]){
			++ans;
		}
	}
	cout<<ans;
	return 0;
}
